var checklist;
var inc;
var a;
var s;
var sArray;

checklist = new GlideRecord('x_mema_morning_che_weekend_checklist');
checklist.orderByDesc('sys_created_on');
checklist.chooseWindow(0,1);
checklist.query();
if (checklist.next()) {
	inc = new GlideRecord('incident');
	if (checklist.getValue("disk") == 'Error'){
		a = checklist.getValue("disk_info");
		s = a.toString();
		sArray = s.split("\n");
		for (count=0; count < sArray.length; count++) {
			inc.newRecord();
			inc.initialize();
			inc.short_description = sArray[count];
			inc.assignment_group.setDisplayValue('Sys Admin');
			inc.category = "Weekend Checklist";
			inc.subcategory = "Branch Server Disk Space";
			inc.urgency = 3;
			inc.priority = 3;
			inc.update();
		}
	}
